import React from "react";
import { Link } from "react-router-dom";

const Error = () => {
	return (
		<div className="error-page section">
			<div className="error-container">
				<h1>oops! it's a dead end</h1>
			</div>
			<Link to="/" className="btn btn-primary">
				back home
			</Link>
		</div>
	);
};

export default Error;
